import React, { useEffect, useState } from "react"
import "./home.css"

const Home = () => {

    const [ popularMovies, setPopularMovies ] = useState([])

    useEffect(() => {
        fetch("https://api.themoviedb.org/3/movie/popular?api_key=fe11d9b7470d00366320499ef7614301&language=en-US")
        .then(res => res.json())
        .then(data => setPopularMovies(data.results))
    }, [])


    return (
        <>
           Home Page
        </>
    )
}

export default Home
